                                            type="text"
                                            id="handleName"
                                            name="handleName"
                                            value={formData.handleName}
                                            onChange={(event) => handleChange(event, index)}
                                            disabled={formData.modelName === '' || selectedMaterial == 'Пиластър' || selectedMaterial == 'Чекмедже'}
                                        >
                                            <option value="Без Дръжка">Без дръжка</option>
